import React from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const VotePage = () => {
    const navigate = useNavigate();
    const handleLogout = () => {
        // Perform logout tasks here
        navigate("/"); // Navigate to the login page
    };

    const candidateDetails = {
        fullName: "Shehbaz Sharif",
        gender: "Male",
        dateOfBirth: "1951-09-23",
        placeOfBirth: "Lahore",
        partyMembership: "PML-N",
    };

    return (
        <div style={styles.container}>
            {/* Header Section */}
            <header style={styles.header}>
                <h1 style={styles.title}>Pakistan Election Portal</h1>
                <nav style={styles.navbar}>
                    <a href="" style={styles.navLink}></a>
                    <a href="" style={styles.navLink}>Cast Vote</a>
                    <a href="" style={styles.navLink}>Election Results</a>
                    <a href="" style={styles.navLink}>Discussion Forums</a>
                    <a href="" style={styles.navLink}>Contact us</a>
                    <a onClick={handleLogout} href="" style={styles.navLink}>Log Out</a>
                </nav>
            </header>

            {/* Hero Section */}
            <section style={styles.hero}>
                <h2 style={styles.heroTitle}>Cast Your Vote</h2>
                <p style={styles.heroText}>
                    Your vote is crucial to a transparent and fair election. Review the candidates and make your choice!
                </p>
            </section>

            {/* Candidates Section */}
            <section style={styles.candidateSection}>
                <h3 style={styles.candidateTitle}>Candidates for Election</h3>
                <div style={styles.candidateCard}>
                    <h4 style={styles.candidateName}>{candidateDetails.fullName}</h4>
                    <p style={styles.candidateDetail}>Gender: {candidateDetails.gender}</p>
                    <p style={styles.candidateDetail}>Date of Birth: {candidateDetails.dateOfBirth}</p>
                    <p style={styles.candidateDetail}>Place of Birth: {candidateDetails.placeOfBirth}</p>
                    <p style={styles.candidateDetail}>Party: {candidateDetails.partyMembership}</p>
                    <button style={styles.voteButton}>Vote for {candidateDetails.fullName}</button>
                </div>
            </section>

            {/* Footer Section */}
            <footer style={styles.footer}>
                <p style={styles.footerText}>Â© 2024 Pakistan Election Portal. All rights reserved.</p>
                <p style={styles.footerText}>Made with care for democracy.</p>
            </footer>
        </div>
    );
};

const styles = {
  container: {
    fontFamily: "'Roboto', sans-serif",
    color: "#1a2b2d",
    backgroundColor: "#ffffff",
    margin: 0,
    padding: 0,
    display: "flex",
    flexDirection: "column",
    minHeight: "100vh",
  },
  header: {
    backgroundColor: "#1a2b2d",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "20px",
  },
  title: {
    color: "#ffffff",
    fontSize: "28px",
    fontFamily: "'Roboto Slab', serif",
    margin: 0,
  },
  navbar: {
    display: "flex",
    gap: "15px",
  },
  navLink: {
    color: "#ffffff",
    textDecoration: "none",
    fontSize: "16px",
    fontWeight: "500",
  },
  hero: {
    textAlign: "center",
    padding: "60px 20px",
    backgroundColor: "#ffffff",
    flexGrow: 1,
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
  },
  heroTitle: {
    fontSize: "36px",
    fontFamily: "'Roboto Slab', serif",
    marginBottom: "20px",
    color: "#1a2b2d",
  },
  heroText: {
    fontSize: "18px",
    marginBottom: "30px",
    color: "#1a2b2d",
    fontWeight: "400",
  },
  candidateSection: {
    padding: "40px 20px",
    textAlign: "center",
    backgroundColor: "#1a2b2d",
    flexGrow: 1,
  },
  candidateTitle: {
    fontSize: "30px",
    fontFamily: "'Roboto Slab', serif",
    marginBottom: "20px",
    color: "#1a2b2d",
  },
  candidateCard: {
    backgroundColor: "#ffffff",
    padding: "20px",
    borderRadius: "8px",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    maxWidth: "400px",
    margin: "0 auto",
  },
  candidateName: {
    fontSize: "24px",
    color: "#1a2b2d",
    fontWeight: "500",
  },
  candidateDetail: {
    fontSize: "18px",
    color: "#1a2b2d",
    marginBottom: "8px",
  },
  voteButton: {
    marginTop: "20px",
    padding: "10px 20px",
    fontSize: "16px",
    backgroundColor: "#1a2b2d",
    color: "#ffffff",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    fontWeight: "500",
  },
  footer: {
    backgroundColor: "#1a2b2d",
    textAlign: "center",
    padding: "20px",
    color: "#ffffff",
    marginTop: "auto",
  },
  footerText: {
    fontSize: "14px",
    margin: "5px 0",
    fontWeight: "400",
  },
};

export default VotePage;
